### Describe the feature request

Reading inputs in a custom operator through the C-API involves first getting an `OrtValue` using the following function as defined in the [public onnxruntime_c_api.h file](https://github.com/microsoft/onnxruntime/blob/f88b97ede272e54d67e7f4da165359df4b534a4a/include/onnxruntime/core/session/onnxruntime_c_api.h#L1752-L1753):

```c
ORT_API2_STATUS(
   KernelContext_GetInput, _In_ const OrtKernelContext* context, _In_ size_t index, _Out_ const OrtValue** out
);
```
The retrieved `OrtValue` is `const`. As far as I can see, the only function to then read the tensor data is:

```c
ORT_API2_STATUS(GetTensorMutableData, _In_ OrtValue* value, _Outptr_ void** out);
```
which requires a non-const `OrtValue`. 

For the c++ API this is ["fixed"](https://github.com/microsoft/onnxruntime/blob/f88b97ede272e54d67e7f4da165359df4b534a4a/include/onnxruntime/core/session/onnxruntime_cxx_inline.h#L1748-L1753) with a `const_cast`:
```c++
template <typename T>
inline const T* CustomOpApi::GetTensorData(_Inout_ const OrtValue* value) {
  T* data = nullptr;
  Ort::ThrowOnError(api_.GetTensorMutableData(const_cast<OrtValue*>(value), reinterpret_cast<void**>(&data)));
  return data;
}
```

It is unfortunate that the current C-API necessitates casting `const` away (as far as I can tell) in order to get to the data. Either `KernelContext_GetInput` should not enforce `const`ness or a new function should be made available in the C-API to retrieve the tensor data from a `const OrtValue*` without the risk of undefined behavior. 

### Describe scenario use case

An updated C-API would make it easier and less anxiety-inducing to write custom operators. It is most likely unclear to an author of a custom op what is happening inside `GetTensorMutableData` and casting `const` away can potentially introduce undefined behavior.

Currently I am doing inference using tensorflow-node to manipulate images:

```typescript
async function run() {
  const session = await ort.InferenceSession.create(modelPath);
  console.log(session)
  const file = await readFile(imagePath)
  const r = tf.node.decodeJpeg(file).toFloat()
  const buffer = r.dataSync()
  const t = new ort.Tensor("float32", new Float32Array(buffer), [1, 3, 640, 640])
  const result = await session.run({ images: t })
  console.log(result)
}

run()
```

Is there a way to just load an image into ONNX node? I think it is only possible for the web. I read all the docs, nothing useful so far.

Hello! Our static bug checker has found a performance issue in onnxruntime/python/tools/transformers/benchmark.py:  `run_with_tf_optimizations` [(1)](https://github.com/microsoft/onnxruntime/blob/2ef25a22007f894e811553ab954b588b93897d56/onnxruntime/python/tools/transformers/benchmark.py#L506)[(2)](https://github.com/microsoft/onnxruntime/blob/2ef25a22007f894e811553ab954b588b93897d56/onnxruntime/python/tools/transformers/benchmark.py#L510)[(3)](https://github.com/microsoft/onnxruntime/blob/2ef25a22007f894e811553ab954b588b93897d56/onnxruntime/python/tools/transformers/benchmark.py#L514) is repeatedly called in a for loop, but there are tf.function decorated functions [`run_in_eager_mode`](https://github.com/microsoft/onnxruntime/blob/2ef25a22007f894e811553ab954b588b93897d56/onnxruntime/python/tools/transformers/benchmark.py#L411) and [`run_in_graph_mode`](https://github.com/microsoft/onnxruntime/blob/2ef25a22007f894e811553ab954b588b93897d56/onnxruntime/python/tools/transformers/benchmark.py#L416) defined and called in  [`run_with_tf_optimizations`](https://github.com/microsoft/onnxruntime/blob/2ef25a22007f894e811553ab954b588b93897d56/onnxruntime/python/tools/transformers/benchmark.py#L404). 

In that case, when `run_with_optimizations` is called in a loop, the functions `run_in_eager_mode` and `run_in_graph_mode` will create a new graph every time, and that can trigger tf.function retracing warning.

Here is [the tensorflow document](https://tensorflow.google.cn/guide/function#tracing) to support it.

Briefly, for better efficiency, it's better to use:
```python
@tf.function
def inner():
    pass

def outer():
    inner()  
```
than:
```python
def outer():
    @tf.function
    def inner():
        pass
    inner()
```

Looking forward to your reply.

